import React from 'react';
import './searchstyle/imageList.css';

const ImageList = (props) => {
    console.log("images"+props.image)
    const images = props.image.map(({id,alt_description,description,urls})=>{
        console.log('descript:'+id)
        return(
            <div className='imageDiv' key={id}>
                <hr></hr>

                <img src={urls.thumb} />
                <h3>{alt_description}</h3>
                <p>{description}</p>
                <hr></hr>
                <br/>
            </div>
        )
    })
    return (
        <div className='imageList'>ImageList:{
            images
        }</div>
    );
};
export default ImageList;
